import React from 'react';
import {Container} from 'react-bootstrap';
import './App.css';
import Footer from './components/footer';
import Header from './components/header';

function App() {
  return (
    <div>
      <Header/>
        <Container>
          <h1>
            Welcome
          </h1>
        </Container>

      <Footer/>
    </div>
  );
}

export default App;
